import React, { useState, useEffect } from "react";
import {
  Box,
  TextField,
  MenuItem,
  styled,
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Button,
  Dialog,
  DialogTitle,
  DialogContent,
  DialogActions,
  IconButton,
  FormControl,
  InputLabel,
  Select,
} from "@mui/material";
import CloseIcon from "@mui/icons-material/Close";
import DeleteIcon from "@mui/icons-material/Delete";
import EditIcon from "@mui/icons-material/Edit";
import { Formik, Form, Field } from "formik";
import axios from "axios";
import InteviewPortal from "./InteviewPortal";

// Styled components
const BootstrapDialog = styled(Dialog)(({ theme }) => ({
  "& .MuiDialogContent-root": {
    padding: theme.spacing(2),
  },
  "& .MuiDialogActions-root": {
    padding: theme.spacing(1),
  },
}));

const StyledTableCell = styled(TableCell)(({ theme }) => ({
  [`&.${theme.tableCellClasses?.head}`]: {
    backgroundColor: "#1976d2",
    color: theme.palette.common.white,
  },
  [`&.${theme.tableCellClasses?.body}`]: {
    fontSize: 14,
  },
}));

const StyledTableRow = styled(TableRow)(({ theme }) => ({
  "&:nth-of-type(odd)": {
    backgroundColor: theme.palette.action.hover,
  },
  "&:last-child td, &:last-child th": {
    border: 0,
  },
}));

const Tokan =
  "eyJhbGciOiJIUzI1NiIsInR5cCI6IkpXVCJ9.eyJpZCI6IjY3ODA4YTE3MzRkZGY2ZjZlZGUyNTRmMSIsImlhdCI6MTc0MzA1NTQyMn0.aZYxyCRQ1STR-TFhknYeX8hpE5jBi2jFSqTnt5RLXHU";

const QandA = () => {
  const [open, setOpen] = useState(false);
  const [ini, setIni] = useState({
    questions: "",
    answer: "",
    subcategoryID: "",
  });
  const [list1, setList1] = useState([]);
  const [list2, setList2] = useState([]);
  const [editId, setEditId] = useState(null);

  // Fetch Questions
  const dataView = () => {
    axios
      .get("https://interviewback-ucb4.onrender.com/questions/", {
        headers: { Authorization: Tokan },
      })
      .then((res) => setList2(res.data.data))
      .catch((error) => console.log(error));
  };

  // Fetch Subcategories
  const handleFillsubcatagary = () => {
    axios
      .get("https://interviewback-ucb4.onrender.com/subcategory/", {
        headers: { Authorization: Tokan },
      })
      .then((res) => setList1(res.data.data))
      .catch((error) => console.log(error));
  };

  useEffect(() => {
    dataView();
    handleFillsubcatagary();
  }, []);

  // Handle Submit
  const handleSubmit = (values, { resetForm }) => {
    if (editId) {
      axios
        .patch(`https://interviewback-ucb4.onrender.com/questions/${editId}`, values, {
          headers: { Authorization: Tokan },
        })
        .then(() => {
          dataView();
          setEditId(null);
        })
        .catch((err) => console.log(err));
    } else {
      axios
        .post("https://interviewback-ucb4.onrender.com/questions/create", values, {
          headers: { Authorization: Tokan },
        })
        .then(() => {
          dataView();
          resetForm();
        })
        .catch((error) => console.log(error));
    }
    handleClose();
  };

  // Handle Edit
  const editData = (id, row) => {
    setOpen(true);
    setEditId(id);
    setIni({
      questions: row.questions,
      answer: row.answer,
      subcategoryID: row.subcategoryID?._id,
    });
  };

  // Handle Delete
  const deleteData = (id) => {
    axios
      .delete(`https://interviewback-ucb4.onrender.com/questions/${id}`, {
        headers: { Authorization: Tokan },
      })
      .then(() => dataView())
      .catch((err) => console.log(err));
  };

  // Dialog Handlers
  const handleClickOpen = () => setOpen(true);
  const handleClose = () => setOpen(false);

  return (
    <InteviewPortal>
      <Box sx={{ display: "flex", justifyContent: "flex-end", p: 2 }}>
        <Button
          sx={{ backgroundColor: "#1976d2", color: "white" }}
          variant="outlined"
          onClick={handleClickOpen}
        >
          ADD Q & A
        </Button>
      </Box>

      {/* Form Dialog */}
      <BootstrapDialog open={open} onClose={handleClose}>
        <DialogTitle>Add Q & A</DialogTitle>
        <IconButton
          sx={{ position: "absolute", right: 8, top: 8 }}
          onClick={handleClose}
        >
          <CloseIcon />
        </IconButton>

        <Formik enableReinitialize initialValues={ini} onSubmit={handleSubmit}>
          {({ setFieldValue }) => (
            <Form>
              <DialogContent dividers>
                <Field as={TextField} name="questions" label="Question" fullWidth margin="dense" />
                <Field as={TextField} name="answer" label="Answer" fullWidth margin="dense" />

                <FormControl fullWidth margin="dense">
                  <InputLabel>Subcategory</InputLabel>
                  <Select
                    name="subcategoryID"
                    value={ini.subcategoryID}
                    onChange={(e) => setFieldValue("subcategoryID", e.target.value)}
                  >
                    {list1.map((row) => (
                      <MenuItem key={row._id} value={row._id}>
                        {row.subCategoryname}
                      </MenuItem>
                    ))}
                  </Select>
                </FormControl>
              </DialogContent>
              <DialogActions>
                <Button type="submit" sx={{ backgroundColor: "#1976d2", color: "white" }}>
                  Submit
                </Button>
              </DialogActions>
            </Form>
          )}
        </Formik>
      </BootstrapDialog>

      {/* Data Table */}
      <TableContainer component={Paper}>
        <Table sx={{ minWidth: 200, mt: 2 }}>
          <TableHead>
            <TableRow>
              <StyledTableCell>No.</StyledTableCell>
              <StyledTableCell>Question</StyledTableCell>
              <StyledTableCell>Answer</StyledTableCell>
              <StyledTableCell>Subcategory</StyledTableCell>
              <StyledTableCell>Actions</StyledTableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {list2.map((row, i) => (
              <StyledTableRow key={i}>
                <StyledTableCell>{i + 1}</StyledTableCell>
                <StyledTableCell>{row.questions}</StyledTableCell>
                <StyledTableCell>{row.answer}</StyledTableCell>
                <StyledTableCell>{row.subcategoryID?.subCategoryname}</StyledTableCell>
                <StyledTableCell>
                  <IconButton onClick={() => editData(row._id, row)}>
                    <EditIcon />
                  </IconButton>
                  <IconButton onClick={() => deleteData(row._id)}>
                    <DeleteIcon />
                  </IconButton>
                </StyledTableCell>
              </StyledTableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </InteviewPortal>
  );
};

export default QandA;
